„Do krajských voleb jsme šli s Piráty a tyto volby byly úspěšné. Nepochybuji, že letošní úspěch bude stejně velký, ne-li větší...
Jsem hejtmanem proto, abych spoluvytvářel systém, který nebude zvýhodňovat některé a znevýhodňovat jiné.“
