Gratuluji Vítkovi Rakušanovi ke znovuzvolení předsedou! Jak jsem řekla na sněmu @STANcz: těším se, až SPOLU s Piráty a STAN vyženeme ze Strakovky všechny lháře a zloděje. A pokračovat budeme těmi na Hradě. 

Právě toho se premiér s prezidentem oprávněně bojí.
