Přišlo to, co jsme všichni čekali. Další varování 
@EU_Commission ohledně kontroly střetu zájmů a poskytování dotací firmám ve svěřenských fondech. Kontrola není DOSTATEČNÁ. České úřady by se měly probrat a začít to už řešit. Jinak komise stopne peníze.
https://t.co/OU4MnBnOFQ

@PalatMartin @STANcz @SpoluKoalice No a není to právě ta příležitost nají dlouhodobě udržitelný společenský kompromis ohledně nutných reforem?
Podstatné je se shodnout na důchodové reformě, financování zdravotnictví, konsolidaci veřejných financí. 
Na Středočeském kraji máme přesně tuto koalici a funguje skvěle.

Ve spolupráci s německou zelenou europoslankyní 
@anna_cavazzini se čeští Zelení zúčastní cyklovýletu okolo Turówa. Je potřeba upozorňovat, že tento region potřebuje budoucnost bez uhlí. 

Přijdete se: sraz v neděli 10:00 v Žitavě, podrobnosti na FB: https://t.co/rZbVAX7FAk https://t.co/PFWpLfMEki

